i = 0
def main_spliter(s):
    global i
    def _sub_spliter(s):
        global i
        v = ord(s[i])
        if v >= 40:
            i += 1
            return v - 40
        else:
            kv = 39 - v
            v = 0
            for j in range(kv):
                v *= 87
                v += ord(s[j+1+i]) - 40
            i += kv + 1
            return v + 87
    v = _sub_spliter(s)
    c = s[i:i+v]
    i += v
    return c

def spliter_1(ss):
    a = len(ss)
    b = ord(ss[0]) - 40
    c = ''
    for i in ss[1:]:
        v = ord(i)
        if v >= 40 and v < 127:
            v += b
            if v >= 127:
                v = v - 87
        c += chr(v)
    return c

def split_by_num(ss, num):
    ret = []
    for i in range(len(ss)//num):
        ret.append(ss[i*num:(i+1)*num])
    return ret

