def init_algorithm_box():
    # 这里的 mD和m1是硬编码，后续会根据需求修改
    mD = 'qrcklmDoExthWJiHAp1sVYKU3RFMQw8IGfPO92bvLNj.7zXBaSnu0TC6gy_4Ze5d{}|~ !#$%()*+,-:=?@[]^'
    m1 = ''
    ls = mD.split(m1) if m1 else list(mD)
    bbox = [[None,]*256 for _ in range(5)]
    bbox.append([-1,]*256)
    for i in range(len(ls)):
        ii = ord(ls[i])
        bbox[0][ii] = i<<2
        bbox[1][ii] = i>>4
        bbox[2][ii] = (i&15)<<4
        bbox[3][ii] = i>>2
        bbox[4][ii] = (i&3)<<6
        bbox[5][ii] = i
    return bbox

# 这个加密不太懂，就叫做盒子加密把
bbox = init_algorithm_box()

def deal_box(string):
    l = len(string) - 3
    q = [None]*(len(string)*3//4)
    r = 0
    i = 0
    while i < l:
        a = ord(string[i]); i += 1
        b = ord(string[i]); i += 1
        c = ord(string[i]); i += 1
        d = ord(string[i]); i += 1
        q[r] = bbox[0][a] ^ bbox[1][b]; r+= 1
        q[r] = bbox[2][b] ^ bbox[3][c]; r+= 1
        q[r] = bbox[4][c] ^ bbox[5][d]; r+= 1
    if i < len(string):
        a = ord(string[i]); i += 1
        b = ord(string[i]); i += 1
        q[r] = bbox[0][a] ^ bbox[1][b]; r+= 1
        if i < len(string):
            c = ord(string[i]); i += 1
            q[r] = bbox[2][b] ^ bbox[3][c]; r+= 1
    return q

def deal_box2(ls):
    # 这里的l5是硬编码，后续需要修改
    l5 = '?'
    n = []
    m = ord(l5[0])
    i = 0
    while i < len(ls):
        t = ls[i]
        if t < 0x80:
            t = t
        elif t < 0xc0:
            t = m
        elif t < 0xe0:
            t = ((m & 0x3f) << 6) ^ (ls[i+1] & 0x3f)
            i += 1
        elif t < 0xf0:
            t = ((m & 0x0f) << 12) ^ ((ls[i+1] & 0x3f) << 6) ^ (ls[i+2] & 0x3f)
            i += 2
        elif t < 0xf8:
            t = m
            i += 4
        elif t < 0xfe:
            t = m
            i += 5
        else:
            t = m
        i += 1
        n.append(t)
    return ls

def deal_box3(ls):
    # 这里的m1为硬编码
    m1 = ''
    x = len(ls)
    q,p = int(len(ls)/40960), len(ls)/40960 
    c = [None]*(q if q==p else q+1)
    s = x - 40960
    r = 0
    b = 0
    while r < s:
        c[b] = [chr(i) for i in ls[r:r+40960]] ; b += 1; r += 40960
    if r < x:
        c[b] = [chr(i) for i in ls[r:x]]; b += 1
    p = []
    for i in c:
        p.extend(i)
    return ''.join(p)

def decrypt2(string):
    ls = deal_box(string)
    ls = deal_box2(ls)
    rt = deal_box3(ls)
    return spliter_1(rt)

